import React from 'react';
import classes from './dialogs.module.css';
import {NavLink} from "react-router-dom";
const DialogsItem = (props) => {
    let path = "/dialogs/" + props.id; 
    return (
      <div className={classes.dialog}>
        <NavLink path={path}>{props.name}</NavLink>
      </div>
    );
}

const Dialogs = (props) => {
    return (
        <div className={classes.wrapper}>
            <div className={classes.dialogsItems}>
                <div className={classes.dialog}>Natalya</div>
                <div className={classes.dialog}>Rudick</div>
                <div className={classes.dialog}>Denis</div>
                <div className={classes.dialog}>David</div>
                <div className={classes.dialog}>Rojer</div>
                <div className={classes.dialog}>Max</div>
            </div>
            <div className={classes.messages}>
                <div className={classes.message}>Yo!</div>
                <div className={classes.message}>Hello my friend</div>
                <div className={classes.message}>How are you?</div>
                <div className={classes.message}>I am Ok</div>
            </div>
        </div>
    )
}
export default Dialogs;
